import React, { useState } from 'react';
import MainLayout from '../layout/MainLayout'
import './UserPage.css'
import { useNavigate } from 'react-router-dom';


function UserPage(){
    const [name,Username]=useState(localStorage.getItem("FullName"));
    const [phone,Phonenumber]=useState(localStorage.getItem("Phone#"))
    const [email,getEmail]=useState(localStorage.getItem("email"))
    const [accountinfo,display]=useState();
    const navigate = useNavigate();


    const AccountInfo=()=>{
        display(
    <form className="userpage-form">
    <label>Name:</label>
    <input type="text" value={name} readonly />
    <br />
    <label>Email:</label>
    <input type="email" value={email} readonly />
    <br />
    <label>Phone:</label>
    <input type="tel" value={phone} readonly />
    </form>
        );
    };
    const logout=()=>{
        window.loginStatus=false;
        localStorage.clear();
        navigate('/sign-in');     
    }


    return(
        <MainLayout>
  <div className="userpage-container">
     <h1>Personal Page</h1>

     <div className='userpage-navbar'>
     <ul>
      <li><a href="#home" onClick={AccountInfo}>Account Information</a></li>
      <li><a href="#news">Wallet</a></li>
      <li><a href="#contact">Purchase History</a></li>
      <li><a href="#about" onClick={logout}>Logout</a></li>
     </ul>
     </div>
     <div className="container d-flex justify-content-center">
  <div className="card p-3">
    <div className="d-flex flex-row justify-content-between text-align-center">
      <div className="container d-flex justify-content-center">
        <div className="card p-3">
          <div className="d-flex flex-row justify-content-between text-align-center">
            <img src="https://imgur.com/vvK2ARv.png" />
            <i className="fas fa-ellipsis-v" />
          </div>
          <p className="text-dark">Elementery Business Account</p>
          <div className="card-bottom pt-3 px-3 mb-2">
            <div className="d-flex flex-row justify-content-between text-align-center">
              <div className="d-flex flex-column"><span>Balance amount</span><p>€ <span className="text-white">88,989</span></p></div>
              <button className="btn btn-secondary"><i className="fas fa-arrow-right text-white" /></button>
            </div>
          </div>
        </div>
      </div>
    </div></div></div>

      </div>


            </MainLayout>


    )
}
export default UserPage;
